import { useState, useEffect } from 'react';
import './App.css';

function RenderName(props){
  const [age, setAge] = useState(props.age);
  return(
    <>
      <h1>Name: {props.firstName}</h1>
      <h2>Last Name: {props.lastName}</h2>
      <button onClick={()=> setAge((preAge)=> preAge - 1)}>-</button>
      <h3>Age: {age}</h3>
      <button onClick={()=> setAge((preAge)=> preAge + 1)}>+</button>
    </>
  )
}

function App() {
  useEffect(()=>{
    alert("You've changed the age!" );
  },[])
  return (
    <div className="App">
      <RenderName
        firstName = 'Priaysnhu'
        lastName = 'Katiyar'
        age = {20+1}
      />
      <RenderName
        firstName = 'Himanshu'
        lastName = 'Katiyar'
        age = {24+1}
      />
    </div>
  );
}

export default App;
